import styles from "./Footer.module.css";

function Footer() {
    return (
        <footer>
            <nav className={styles.footbar}>
                <p>JUSTIX&copy; Desenvolvido por JEJE's Bizarre Programing 2024</p>
            </nav>
        </footer>
    );
}

export default Footer;
